INSERT INTO `ow_project_description` VALUES ('acceleo','Acceleo is a code generator which uses the MDA approach to easily design applications with models. Acceleo is natively based on Eclipse EMF and can be extended to target any technology.',180,'2009-07-05 13:54:41'),('activexml','Active XML is a declarative framework based on XML documents with embedded calls to Web services that harnesses web services for data management and is put to work in a peer-to-peer architecture.',180,'2009-07-05 13:54:42'),('apollon','Generation engine able to build graphical user interfaces (GUI) from DTDs and customization models. This makes the GUIs adapted to the edition of XML documents.',180,'2009-07-05 13:54:42'),('aspire','The AspireRFID project aims at developing and promoting an open-source, lightweight, standards-compliant, scalable, privacy-friendly, and integrated middleware to ease the development, the deployment and the management of RFID-based applications.',180,'2009-07-05 13:54:42'),('barracudamvc','Barracuda is an open-source Presentation Framework designed to make it easier to build servlet based webapps by applying proven client-server patterns to the web development paradigm. It includes a DOM based templating mechanism for better separation',180,'2009-07-05 13:54:42'),('been','BEEN: Framework for Integrating Performance Evaluation in Development Cycle',180,'2009-07-05 13:54:42'),('bonita','Bonita provides out of the box workflow functionalities to define and run business processes : enactment engine, APIs, process definition tool and administrative application',180,'2009-07-05 13:54:43'),('bpmadmin','NovaBPM is reference open source BPM platform embedding Bonita XPDL Workflow and Orchestra BPEL projects',180,'2009-07-05 13:54:43'),('bsframework','The Bright Side Framework provides ready-to-use high level components to quickly build J2EE business applications accessed by rich java/Swing clients on HTTP.',180,'2009-07-05 13:54:43'),('cardamom','CARDAMOM is a middleware framework that provides features to configure, deploy and execute near real-time, distributed and fault-tolerant applications.',180,'2009-07-05 13:54:43'),('carol','CAROL (Common Architecture for RMI Objectweb Layer) is a Java RMI (Remote Methods Invocation) management tool.',180,'2009-07-05 13:54:43'),('celtix','Celtix delivers a Java enterprise service bus (ESB) runtime and set of extensibility APIs, simplifying the construction, integration and flexible reuse of technical and business components using a standards-based, service-oriented architecture.',180,'2009-07-05 13:54:43'),('clif','CLIF provides a flexible, extensible Java-based platform for scalable, distributed load injection and performance testing. With the Eclipse-based GUI, use provided or custom load injectors and probes, and run up to millions of vUsers per injector!',180,'2009-07-05 13:54:43'),('cmi','CMI is a framework to enable clustering of all RMI objects. CMI aims to get scalability and high availability for RMI servers. Also, it ensures an up-to-date cluster view for clients and allows to change dynamically the algorithms of load-balancing.',180,'2009-07-05 13:54:43'),('director','Enhydra Director implements web server plugins for Apache, IIS and IPlanet supporting advanced load balancing / clustering and runtime administration. Director can be used with plain Tomcat, Jetty, JBoss, JOnAS or Enhydra Server.',180,'2009-07-05 13:54:43'),('dods','Enhydra DODS is a code generating O/R mapping tool with true SQL queries for predictable performance, configurable templates and data/query caching. Can be used in standalone applications, every application server and of course with Enhydra Server.',180,'2009-07-05 13:54:43'),('dotnetj','DotNetJ is a middleware that gives .NET clients the ability to use Java components or J2EE applications. This project aims at providing .NET-to-Java interoperability without the bottleneck of web services.',180,'2009-07-05 13:54:43'),('dream','Dream is a component-based software framework dedicated to the construction of communication middleware. It provides a component library (based on Fractal) and tools allowing the construction of various communication paradigms.',180,'2009-07-05 13:54:43'),('dryverl','Dryverl is an XML dialect for specifying Erlang-to-C bindings as C port drivers, and a set of XSLT stylesheets that generate all of a binding\'s Erlang and C source code.',180,'2009-07-05 13:54:43'),('dysoweb','Dysoweb provides modularity and dynamicity to serlvet based web applications. Based on OSGi it allows the dynamic deployment of services packaged as bundles.',180,'2009-07-05 13:54:43'),('eaf','Enhydra Application Framework implements the Enhydra &quot;super-servlet&quot;, provides dynamic URL-JSESSIONID rewriting, PO caching, session-, database-, logging-, configuration- and XMLC APIs using adapters for different application servers.',180,'2009-07-05 13:54:43'),('easywsdl','Easy WSDL Toolbox provides a simple and extensible library to handle  WSDL documents with a common and high level API. It handles both WSDL 1.1 or WSDL2.0',180,'2009-07-05 13:54:43'),('eclipse-update','This project is used to manage the ObjectWeb Consortium Eclipse update sites (download.[fr2,us,zh].forge.objectweb.org/eclipse-update) which allow Eclipse users to download ObjectWeb plugins directly from Eclipse.',180,'2009-07-05 13:54:43'),('edemos','Enhydra Demos contains many applications showing various aspects of Enhydra tools and technologies like EAF, XMLC, DODS, Barracuda, Flash, FOP, XSLT, WAP/WML, VXML, SOAP, etc.',180,'2009-07-05 13:54:43'),('enhydra','Enhydra Server is the leading Open Source Java/XML application server supporting latest Servlet and Webservice standards. Enhydra Enterprise is based on JOnAS and supports the full J2EE stack.',180,'2009-07-05 13:54:43'),('epaf','This tool is an Eclipse plug-in based on EPF, which can define process aspects and weave them into SPEM 2.0 (Software Process Engineering Meta-model 2.0) process models.',180,'2009-07-05 13:54:43'),('exoplatform','eXo platform product line: a Portlet Container (JSR 168 + JSR 286 + WSRP2), a Java Content Repository (JCR - JSR 170), an AJAX based Portal (with WebOS layout), a full Enterprise Content Managament (ECM) and a Collaboration Suite ',180,'2009-07-05 13:54:43'),('federid','The FederID project aim to offer a real solution of Identity Management and Identity Federation. Built on existing free software, it profits of the support and the financing of the French National Agency of Research.',180,'2009-07-05 13:54:43'),('frascati','FraSCAti is a Java-based open source implementation of Service Component Architecture (SCA) specifications. Based on the OW2 Fractal component model, FraSCAti provides an open architecture to integrate new SCA component, binding, and intent technologies.',180,'2009-07-05 13:54:43'),('gasp','GASP project (GAming Services Platform) deals with middleware solutions to support Multiplayer Mobile Games (MMG) and Multiplayer Ubiquitous Games (MUGs), that implement and extends the Open Mobile Alliance GS specifications.',180,'2009-07-05 13:54:43'),('gotm','GoTM (GoTM is an open Transaction Monitor) is a component-based framework for building various transaction services. GoTM is developped with the Fractal component model.',180,'2009-07-05 13:54:43'),('howl','HOWL is a logger implementation providing features required by the JOTM project. HOWL uses unformatted binary logs to maximize performance and specifies a journalization API with methods necessary to support JOTM recovery operations.',180,'2009-07-05 13:54:43'),('interldap','InterLDAP is an identity management project based on a Java framework. Main goals are to solve self-management, provisioning, access control and profil management.',180,'2009-07-05 13:54:43'),('introspector','The introspector project aims to create a semantic interface into the GNU GCC compiler and other free tools. The data extracted will be useful for other object brokers. Currently hosted on sourceforge, we will be migrating the project to objectweb.',180,'2009-07-05 13:54:43'),('ivy','This project is used to manage the OW2\'s Ivy Repository (ivy.objectweb.org) which allows project managers using ivy to use a commmon repository.',180,'2009-07-05 13:54:43'),('j2ws','J2WS is a transforming tool to help develop web services efficiently.',180,'2009-07-05 13:54:43'),('jac','Java Aspect Components (JAC) is a framework for aspect-oriented sofware development in Java.',180,'2009-07-05 13:54:43'),('jasmine','JASMINe is an administration tool for the SOA platform aiming to simplify the administrator\'s job and reduce the management costs. It relies on an autonomic system (Jade project) for implementing some autonomous behaviors (self-repair, self-healing).',180,'2009-07-05 13:54:43'),('jass','This project aims to implement new emerging specifications related to the advanced transactions area like the J2EE Activity Service (JSR-95) from Sun or WS-CAF from Oasis.',180,'2009-07-05 13:54:43'),('javaservice','JavaService allows server-type Java programs to be run in the background as a Windows NT/2000/XP system service (aka Unix daemon process).',180,'2009-07-05 13:54:44'),('jawe','Enhydra JaWE is a graphical Java Workflow Editor according to WfMC specifications supporting XPDL as its native file format. JaWE can be used to edit workflow definitions for Enhydra Shark or every other XPDL conformant Workflow server.',180,'2009-07-05 13:54:44'),('jeffree','Java Embedded Framework Free. Based on OSGi v2.0 specification.',180,'2009-07-05 13:54:44'),('jmimetypelib','jmimetypelib is a java library used to find the mime-type of files and streams using file extension and/or magic numbers. Additionally it may return an icon to represent the mime-type file and a locale description.',180,'2009-07-05 13:54:44'),('jnetcontrol','Management and configuring network equipment with support to Telnet protocol ie: Cisco tm, 3COM.',180,'2009-07-05 13:54:44'),('jonas-doc','The jonas-doc project goal is to hold JOnAS documentation translations. The repository will contain one directory per language (French -&gt; jonas-doc-fr, German -&gt; jonas-doc-de, ...).',180,'2009-07-05 13:54:44'),('jonathan','Jonathan is an open source adaptable distributed object platform, which currently provides several personalities, including on compliant with the OMG CORBA specifications and another with the RMI specification.',180,'2009-07-05 13:54:44'),('joram','JORAM (Java Open Reliable Asynchronous Messaging) is an open source implementation of the JMS (Java Message Service) 1.1 API.',180,'2009-07-05 13:54:44'),('jorm','JORM (Java Object Repository Mapping) is an open source adaptable persistence service.',180,'2009-07-05 13:54:44'),('jotm','JOTM (Java Open Transaction Manager) is a fully functional open source standalone transaction manager that implements the XA protocol and is compliant with the JTA APIs.',180,'2009-07-05 13:54:44'),('jsurvey','The purpose of JSurvey is to provide tools for building online survey based on Java (J2EE) technologies. For the moment JSurvey is a started project so there is only a cvs repository with the sources of an online graphical survey example. see the cvs REA',180,'2009-07-05 13:54:44'),('kelp','Enhydra Kelp is the IDE plugin for JBuilder, Netbeans, Eclipse and JDeveloper integrating EAF, Enhydra XMLC and Enhydra DODS into your favorite development environment. It also includes an application wizard for your first steps.',180,'2009-07-05 13:54:44'),('kilim','Kilim is a generic configuration framework based on the concept of configuration by software assembly.',180,'2009-07-05 13:54:44'),('kilim2','This project has not yet submitted a description.',180,'2009-07-05 13:54:44'),('lemonldap','LemonLDAP::NG is a single sign on handler for Apache web server. It manages several levels of cache and gets authentication data from an LDAP directory.',180,'2009-07-05 13:54:44'),('lewys','LeWYS hosts a number of frameworks related to monitoring, based on OW2 Fractal component model. It contains a primary module called lewys, a Fractal monitoring framework providing a library of probes for both hardware and software resources.',180,'2009-07-05 13:54:44'),('lomboz','Lomboz is an eclipse plug-in for J2EE developers by extending eclipse JDT. It employs some of the proven open-source technologies. Supporting the complete development cycle: Code, deploy, test and debug.',180,'2009-07-05 13:54:44'),('maven','This project is used to manage the ObjectWeb\'s Maven Repository (maven.objectweb.org) which allows project managers using maven to use a commmon repository.',180,'2009-07-05 13:54:44'),('mesh','Mesh is a proxy for a remote JDBC driver, which can be accessed as though it were local. ',180,'2009-07-05 13:54:44'),('mobilitools','MobiliTools aims at providing a Java toolbox of independent but combinable and flexible software modules to support mobility of Java objects/agents, with a clear separation between activity, transport and communication concerns.',180,'2009-07-05 13:54:44'),('modfact','(Model Factory) is a Tool Box for the MDA(TM) (Model Driven Architecture)',180,'2009-07-05 13:54:44'),('navilis','Xcalia NAViLIS Web allows a developer to browse, query for, create, update, and delete business objects that are mapped to a live database. NAViLIS Web is like a database browser, except that the user navigates Java objects instead of database tables.',180,'2009-07-05 13:54:44'),('newsadmin','This project has not yet submitted a description.',180,'2009-07-05 13:54:44'),('noah','Noah is an implementation of an Interaction Service. &lt;br&gt;Interactions between components are described using a specific language (ISL). &lt;br&gt;Successive Adaptations are merged in a commutative and associative way.',180,'2009-07-05 13:54:44'),('objectweb-zh','ObjectWeb Chinese Project is a work in progress to translate ObjectWeb Document, localize ObjectWeb Projects and prompt ObjectWeb Open Source in China. This project serves as the file repository for the document translation effort.',180,'2009-07-05 13:54:44'),('ocelot','OCELOT is an Open Collaborative Environment for the Leverage of Online insTrumentation. It is a Framework to easily create and deploy collaborative-based applications in order to operate one or several real remote devices over the Internet.',180,'2009-07-05 13:54:44'),('ofccharts','OFC Charts fills the need for publishing reports and statistics in graphical format such as curves and histograms. Fully written in JAVA and compatible with all popular IDEs it creates graphics in industry standard JPEG, PNG and SVG formats.',180,'2009-07-05 13:54:44'),('oncepi','As an Integration-Oriented business process management system, OncePI project provides a platform to construct dynamic process flexibly and efficiently.',180,'2009-07-05 13:54:44'),('opalval','Project for validation of ow2 forge',180,'2009-07-05 13:54:44'),('openediint','Open EDIINT is an open source implementation of EDIINT standards. It provides a component library and tools to build applications that allow companies to integrate with their partners, making Electronic Data Interchange over the Internet.',180,'2009-07-05 13:54:44'),('openmobileis','Open Mobile IS is a Java framework that aim to provide all the functionalities and components needed for the developpement of entreprise mobile application.',180,'2009-07-05 13:54:44'),('ops','Orbeon Forms is an open source forms solution that handles the complexity of forms typical of the enterprise or government. It is delivered to standard web browsers thanks to XForms and Ajax technology, with no need for client-side software or plugins.',180,'2009-07-05 13:54:44'),('orchestra','Orchestra is a Web Service Orchestration Suite based on the OASIS standard BPEL (Business Process Execution Language). ',180,'2009-07-05 13:54:44'),('orientwareccm','A CCM implementation in C++',180,'2009-07-05 13:54:45'),('oscar','Oscar is an open source implementation of the Open Services Gateway Initiative (OSGi) framework.',180,'2009-07-05 13:54:45'),('oslcv3','Open Source License Checker V.3 is tool for inspection and analysis of license information from open source packages.',180,'2009-07-05 13:54:45'),('oyster','Enhydra Oyster is a Java library for SMIME signing and encryption using different key strengths and algorithms. It is developed with suport and testing for major E-Mail clients.',180,'2009-07-05 13:54:45'),('pargres','ParGRES is a Database Cluster Middleware whose main goal is to efficiently process heavy-weight queries (e.g. OLAP). Our query processing combines intra and inter-query parallelism, while using replication and virtual fragmentation over a PC cluster.',180,'2009-07-05 13:54:45'),('petals','The PETALS Services Platform provides a distributed open source implementation of Java Business Integration (JBI) spec as a core element to build OW2 ESB solutions, leveraging existing Consortium s components.',180,'2009-07-05 13:54:45'),('pkuas','JOnAS PKU is a light-weight application server prototype. It functions as component operating platform based on Java/J2EE technology. It aims at exploring advanced middleware features like easy of management, flexibility, and open to change.',180,'2009-07-05 13:54:45'),('polyorb','PolyORB is a schizophrenic middleware that has an original architecture decoupling protocol personalities from application personalities. PolyORB enables in the same middleware: configurability, genericity and M2M.',180,'2009-07-05 13:54:45'),('q-impress','IDE for predicting impact of design decisions on performance and other aspects of quality of service in component-based and service-oriented applications.',180,'2009-07-05 13:54:45'),('rubbos','RUBBoS is a bulletin board benchmark modeled after an online news forum like Slashdot. It is used for design patterns and J2EE servers performance scalability evaluation. RUBBoS provides the essential bulletin board features such as discussion threads.',180,'2009-07-05 13:54:45'),('rubis','RUBiS is an auction site prototype modeled after eBay.com. It is used for design patterns and J2EE servers performance scalability evaluation.',180,'2009-07-05 13:54:45'),('s4allsdk','S4All-SDK is a toolkit to build a Java standard based service oriented platform',180,'2009-07-05 13:54:45'),('salome-tmf','SalomeTMF is a test management tool like TestDirector (trademark of Mercury Interactive Corporation), aiming to provide an open framework allowing, the automatic tests execution, the production of documents, and the management of defects/requirements.',180,'2009-07-05 13:54:45'),('scarbo','Scarbo brings technology agnostic Business Process design and execution to your service architecture. Built on Eclipse Java Workflow Tooling (JWT) and the Frascati SCA platform, it supports the Nova Bonita workflow engine while being open to others.',180,'2009-07-05 13:54:45'),('shark','Enhydra Shark is a workflow server with a difference. Shark is completely based on standards from WfMC and OMG using XPDL as its native workflow definition language. The Shark framework can be configured to support different environments.',180,'2009-07-05 13:54:45'),('snapper','Enhydra Snapper is a fulltext search library / framework in Java based on Apache Lucene to build search engine applications or integrate fulltext search into applications.',180,'2009-07-05 13:54:45'),('soda','The SODA project will develop an ecosystem (runtime and tools) for building service-oriented systems running on embedded devices. Both a C/C++ and a Java (J2ME CDC) version will be developed.',180,'2009-07-05 13:54:45'),('sofa','SOFA provides a platform for designing applications composed of hierarchical, dynamically updatable components, interconnected by connectors hiding deployment details. Communication among the components can be captured formally by behavior protocols.',180,'2009-07-05 13:54:45'),('spago','Spago is a J2EE framework that provides a solution to the needs of multichannel applications and integration services. It allows to develop web applications,integrating existing infrastructures and publishing the services on different channels.',180,'2009-07-05 13:54:45'),('spago4q','Spago4Q  is a platform for assessing the maturity of the software development process and product, by evaluating data and measures collected from the development tools with non-invasive techniques, in order to improve the overall quality.',180,'2009-07-05 13:54:45'),('spagobi','SpagoBI is a Business Intelligence Free Platform which uses many FOSS tools as analytical engines, integrating them in an infrastructure which offers a cross-operativeness and a consistent vision between Report,OLAP,Data Mining,Dashboard and over the DWH',180,'2009-07-05 13:54:45'),('starwebservice','StarWebService is an independent platform for developing, deploying, managing and running Web Services.',180,'2009-07-05 13:54:45'),('stock-online','Stock-Online is the CSIRO application used to stress middleware performance and scalability. This open-source version is implemented in EJB 1.1, and provides two alternative design choices (Session bean + JDBC, and Session bean + CMP Entity beans).',180,'2009-07-05 13:54:46'),('surf','SURF (Fault Tolerance by Replication with Universal Services) is a Java library replication service for arbitrary deterministic objects. In crash situations objects can still be accessed with replication transparent to the application developer.',180,'2009-07-05 13:54:46'),('think','THINK is a software framework for building component-based system kernels. As an implementation of the Fractal model, it clearly separates architectural from functional apects, provides flexibility, encourages code re-use and reduces development time.',180,'2009-07-05 13:54:46'),('tox','This project has not yet submitted a description.',180,'2009-07-05 13:54:46'),('ubistar','Ubistar Project is a platform which support the development of the pervasive computing applications.',180,'2009-07-05 13:54:46'),('wcms','This project has not yet submitted a description.',180,'2009-07-05 13:54:46'),('wsunit','WSUnit is a tool that can help you test Web Services. It provides a predictable and repeatable simulation of a Web Service that is ideal for unit testing.',180,'2009-07-05 13:54:46'),('xmlc','Enhydra XMLC radically simplifies web development by cleanly separating presentation from code.',180,'2009-07-05 13:54:46'),('xplus','xPlus is a implementation of the persistence provider of Enterprise Java Beans 3.0, also known as the Java Persistence API (JPA). It can be used as a stand-alone POJO persistence layer, or it can be integrated into any EJB3.0 compliant container.',180,'2009-07-05 13:54:46'),('xquare','The XQuare project provides a set of Java components for extending J2EE platforms with XML-based, heterogeneous information integration capabilities, using the XQuery language',180,'2009-07-05 13:54:46'),('xservice','XService suite, which is powered by ACT (The Institute of Advanced Computing Technology), Beihang University, Beijing, China, is a suite focus on xml and web service and provide fundamental element to enable service oriented architecture(SOA).',180,'2009-07-05 13:54:46'),('xwiki','XWiki is a second-generation wiki. See http://xwiki.org for all details.',180,'2009-07-05 13:54:46'),('zeus','Open source Java-to-XML Data Binding tool.',180,'2009-07-05 13:54:46');
